import React, {useState, useEffect} from "react";
import "./App.css";

function Shop() {
  useEffect(() => {
    fetchItems();
  }, []);
  const [items, setItems] = useState([]);
  const fetchItems = async () => {
    const issam = await fetch(
      'https://fortnite-api.theapinetwork.com/upcoming/get'
      );
      const items = await issam.json();
      console.log(items.data);
      setItems(items.data);

  }
  return (
    <div>
      {items.map((item) => (
       <h1 key={item.itemId}>{item.rows}</h1>
      ))}
    </div>
  );
}

export default Shop;
